@import url("https://fonts.googleapis.com/css2?family=Roboto+Mono:wght@300;400;500;600;700&family=Roboto:wght@300;400;500;700&display=swap");

$bodyFont: "Roboto", sans-serif;
$accentFont: "Roboto Mono", monospace;

$font12: 0.75rem;
$font14: 0.875rem;
$font16: 1rem;
$font18: 1.125rem;
$font22: 1.375rem;

$bold: 700;
$semibold: 500;
$regular: 400;

@mixin bodyFont($size, $weight) {
   font-family: $bodyFont;
   font-size: $size;
   font-weight: $weight;
   line-height: calc(#{$size} + 0.5rem);
}
@mixin accentFont($size, $weight) {
   font-family: $accentFont;
   font-size: $size;
   font-weight: $weight;
   line-height: calc(#{$size} + 0.5rem);
}

