sources.sass/components/_accordion.scss:
.accordion {
   $this: &;
   padding: 4px;

   &__button {
      @include accentFont($font14, $semibold);
      position: relative;
      color: var(--accordionButton);
      min-height: 40px;
      padding: 8px 0px;
      width: 100%;
      display: flex;
      justify-content: space-between;
      align-items: center;
      box-shadow: inset 0px -1px 0px var(--accordionBorder);
      cursor: pointer;
      z-index: 0;
      transition: all 0.3s ease;
      border-radius: 0px;

      &:before,
      &:after {
         content: "";
         position: absolute;
         left: 0;
         border-radius: 8px;
         background: var(--accentColor);
         z-index: -1;
         opacity: 0;
         transition: all 0.2s ease;
      }

      &:before {
         width: 100%;
         height: 100%;
      }

      &:after {
         height: calc(100% - 12px);
         width: 0px;
      }

      &:hover {
         padding: 8px 16px;

         &:after {
            opacity: 1;
            width: 4px;
         }
      }
   }

   &__list {
      height: auto;
      max-height: 0;
      opacity: 0;
      pointer-events: none;
      transition: all 0.3s ease;
      overflow: hidden;
      margin-top: 4px;
   }

   &__listItem {
      @include bodyFont($font14, $regular);
      color: var(--accordionText);
      border-bottom: 1px solid var(--accordionBorder);
      padding: 16px;
      cursor: pointer;
      transition: all 0.4s ease;

      &:first-child {

         border-radius: 8px 8px 0px 0px;
      }

      &:last-child {
         border-bottom: none;
         border-radius: 0px 0px 8px 8px;
      }

      &:hover {
         color: var(--accordionTextHover);
         background: var(--accordionBgHover);
      }
   }

   &.open {
      background: var(--accordionBg);
      border-radius: 12px;
      box-shadow: 0px 4px 21px -8px rgba(0, 0, 0, 0.25);
      margin-bottom: 8px;

      &:nth-last-of-type() {
         margin-bottom: 0;
      }

      #{$this} {
         &__list {
            opacity: 1;
            pointer-events: all;
         }

         &__button {
            color: $neu-01;
            box-shadow: none;
            padding: 8px 16px;

            &:before {
               opacity: 1;
            }

            &:after {
               opacity: 0;
            }
         }
      }
   }
}

sources.sass/components/_block.scss:
.block {
   background: var(--blockBg);
   box-shadow: 0px 4px 36px rgba(0, 0, 0, 0.05);
   border-radius: 16px;
   width: 100%;
   height: 600px;
   max-height: 590px;
   overflow: hidden;
   position: relative;

   @include tablet {
      max-height: unset;
      max-width: 480px;
   }

   @include phablet {
      padding: 24px 16px;
   }

   &:before {
      content: "";
      position: absolute;
      width: 100%;
      left: 0;
      bottom: 0px;
      height: 100px;
      background: linear-gradient(transparent, var(--blockBg) 80%);
      z-index: 1;
      opacity: 0;
      pointer-events: none;
      visibility: hidden;
   }

   &.fadeBottom {
      display: flex;
      justify-content: center;

      &:before {
         opacity: 1;
         visibility: visible;
      }
   }

   &__content {
      padding: 32px 40px;
      max-height: 100%;
      overflow-y: auto;

      &::-webkit-scrollbar {
         display: none;
      }
   }
}

sources.sass/_core/_breakpoints.scss:
// Breakpoints - Media Queries
$desktop: 1440px; // From 1440 to 1280
$laptop: 1279px; // From 1279 to 1024
$tablet: 1023px; // From 1023 to 768
$phablet: 767px; // From 767 to 512
$mobile: 511px; // From 511 to 360
$mobile-small: 359px; // From 359 to 0

@mixin desktop {
   @media (max-width: #{$desktop}) {
      @content;
   }
}

@mixin laptop {
   @media (max-width: #{$laptop}) {
      @content;
   }
}

@mixin tablet {
   @media (max-width: #{$tablet}) {
      @content;
   }
}

@mixin phablet {
   @media (max-width: #{$phablet}) {
      @content;
   }
}

@mixin mobile {
   @media (max-width: #{$mobile}) {
      @content;
   }
}

@mixin mobile-small {
   @media (max-width: #{$mobile-small}) {
      @content;
   }
}

sources.sass/components/_button.scss:
.button {
   @include accentFont($font16, $semibold);
   background: var(--accentColor);
   color: $neu-01;
   height: 40px;
   padding: 0 24px;
   border-radius: 10px;
   line-height: 1.375rem;
   cursor: pointer;
   transition: all 0.3s ease;
   width: fit-content;
   display: flex;
   justify-content: center;
   align-items: center;
   position: relative;
   overflow: hidden;
   z-index: 0;

   &:before {
      content: "";
      position: absolute;
      width: 0%;
      height: 100%;
      background: var(--accentColor);
      transform: rotate(-180deg);
      right: 0;
      top: 0;
      z-index: -1;
      opacity: 0;
      transition: all 0.3s ease;
   }

   &:hover {
      transform: translateY(2px);

      &:before {
         opacity: 1;
         width: 100%;
         left: 0;
         right: inherit;
      }
   }

   &.icon {
      width: 32px;
      height: 32px;
      padding: 0;
      border-radius: 4px;

      i {
         width: 24px;
         height: 24px;
         // font-size: 23px;
         display: flex;
         justify-content: center;
         transform: scale(0.95);
      }

      &:hover {
         transform: none;
      }
   }
}

sources.sass/components/_forms.scss:
.forms {
   display: flex;
   flex-direction: column;
   align-items: center;
   gap: 16px;
   margin-top: 24px;

   .input,
   .textArea {
      position: relative;
      width: 100%;
      display: flex;
      align-items: center;

      input,
      textarea {
         @include bodyFont($font14, $regular);
         background: var(--inputBg);
         border-radius: 8px;
         box-shadow: inset 0px 0px 0px 1px var(--inputOutline);
         color: var(--inputText);
         width: 100%;
         height: 100%;
         padding: 0 16px;
         transition: all 0.2s ease;

         &::placeholder {
            @include accentFont($font12, $regular);
            color: var(--inputText);
            opacity: 0.6;
            transition: all 0.2s ease;
         }
         &:focus {
            box-shadow: inset 0px 0px 0px 2px var(--inputOutline);
            &::placeholder {
               opacity: 1;
            }
         }
      }
   }

   .input {
      height: 40px;

      .button.icon {
         position: absolute;
         right: 4px;
      }
   }

   .inputIcon {
      input {
         padding: 0 48px 0 16px;
      }
   }

   .textArea {
      height: 180px;

      textarea {
         resize: none;
         padding: 16px;
      }
   }

   .checkbox {
      gap: 16px;
      align-items: flex-start;
      height: auto;
      input[type="checkbox"] {
         position: relative;
         cursor: pointer;
         appearance: none;
         width: 24px;
         min-width: 24px;
         height: 24px;
         min-height: 24px;
         padding: 0;
         border-radius: 4px;

         &:focus {
            box-shadow: inset 0px 0px 0px 1px var(--inputOutline);
         }
      }

      input[type="checkbox"]:after {
         font-family: "feather" !important;
         content: "\e92b";
         display: block;
         width: 24px;
         height: 24px;
         font-size: 22px;
         position: absolute;
         top: 0px;
         left: 0px;
         display: flex;
         align-items: center;
         justify-content: center;
         opacity: 0;
         transition: all 0.2s ease;
         transform: scale(0.5);
      }
      input[type="checkbox"]:checked:after {
         opacity: 1;
         transform: scale(1);
      }

      label {
         @include bodyFont($font12, $regular);
         color: var(--inputLabel);
      }
   }

   .buttonSend {
      margin-top: 16px;
   }
}

