sources.sass/_core/_layout.scss:
.wrapper {
   max-width: $desktop;
   margin: 0 auto;
   padding: 0 64px;
   display: grid;
   grid-template-columns: repeat(12, 1fr);
   grid-column-gap: 24px;

   @include tablet {
      padding: 0 40px;
      grid-template-columns: repeat(6, 1fr);
   }
   @include mobile {
      padding: 0 24px;
   }
}

.blocks {
   grid-column: 2/12;
   display: flex;
   justify-content: center;
   gap: 24px;

   @include laptop {
      grid-column: 1/13;
   }

   @include tablet {
      grid-column: 2/6;
      flex-direction: column;
      align-items: center;
   }
   @include phablet {
      grid-column: 1/7;
   }
}

